<template>
  <el-card class="card">
    <el-form
      class="search-form"
      :inline="true"
      label-position="left"
      ref="searchForm"
      :model="searchForm"
      :rules="rules"
    >
      <el-form-item prop="url">
        <el-input
          v-model="searchForm.url"
          :autosize="{ minRows: 2 }"
          type="textarea"
          placeholder="请输入查询网址,多网址换行，一行一个"
          clearable
        ></el-input>
      </el-form-item>
      <el-form-item>
        <el-button @click="submit" type="primary" :loading="loading">{{loading ? '查询中' :'查询'}}</el-button>
      </el-form-item>
    </el-form>

    <el-table :data="searchUrlData" border style="width: 100%">
      <el-table-column type="index" width="30"> </el-table-column>
      <el-table-column prop="url" label="域名" width="180"> </el-table-column>
      <el-table-column prop="include" label="是否收录" width="180"> </el-table-column>
      <el-table-column prop="title" label="收录标题"> </el-table-column>
      <el-table-column prop="imagePath" label="缩略图">
        <template slot-scope="scope">
          <el-image
            v-if="scope.row.imagePath"
            style="width: 100px; height: 100px"
            :src="scope.row.imagePath"
            :preview-src-list="[scope.row.imagePath]"
          >
          </el-image>
        </template>
      </el-table-column>
    </el-table>
  </el-card>
</template>

<script>
import { ipcRenderer } from 'electron'

export default {
  data() {
    return {
      loading: false,
      searchForm: {
        url: '',
      },
      rules: {
        url: [{ required: true, message: '请输入内容', trigger: 'blur' }],
      },
      searchUrlData: [],
    }
  },
  created() {
    ipcRenderer.on('send-message-to-renderer', (event, data) => {
      const item = JSON.parse(JSON.stringify(data))
      console.log('item: ', item)
      if (item.title.length) {
        item.title = item.title[0].title
        item.include = '是'
      } else {
        item.include = '否'
      }
      this.searchUrlData.push(item)
      if(this.searchUrlData.length === this.urlCount){
        this.loading = false
      }
    })
  },
  methods: {
    submit() {
      this.$refs.searchForm.validate(valid => {
        if (valid) {
          this.searchUrlData = []
          this.loading = true
         

          var oparray = []
          var res = this.searchForm.url
          res = res.replace(/^\n*/, "");
          res = res.replace(/\n{2,}/g, "\n");
          res = res.replace(/\n*$/, "");
          oparray = res.split("\n");

          const url = oparray
          this.urlCount = url.length
          console.log('url',url)

          ipcRenderer.send('crawler', url)
          return true
        }
        console.log('error submit!!')
        return false
      })
    },
    // async crawler() {
    //   const browser = await puppeteer.launch({ headless: false })
    //   const page = await browser.newPage()
    //   await page.goto('https://baidu.com')
    //   await page.screenshot({ path: 'example.png' })
    //   await browser.close()
    // },
    open(link) {
      this.$electron.shell.openExternal(link)
    },
  },
}
</script>

